import React, { useCallback } from 'react';
import styled from 'styled-components';
import { Button, Row, Col, Divider } from 'antd';
import Router from 'next/router';

const Header = styled.header`
	padding: 8px 0;
	background-color: #3498db;
	height: 56px;
`;
const HeaderContainer = styled.div`
	display: flex;
	justify-content: space-between;
	align-items: center;
	height: 20px;
`;
const GridRow = styled(Row)`
	height: 100%;
	align-items: center;
`;
const Logo = styled.div``;
const FlexMenu = styled.div`
	margin-left: auto;
`;
const MainWrapper = styled.div`
	background-image: https://github.githubassets.com/images/modules/site/heroes/simple-codelines.svg
`;

const SigninLayout = () => {
	const onLogin = useCallback(() => {
		Router.push('/login');
	});
	const onSignin = useCallback(() => {
		Router.push('/');
	});
	return (
		<>
			<Header>
				<GridRow>
					<Col span={16} offset={4}>
						<HeaderContainer>
							<Logo>FITTIL</Logo>
							<FlexMenu>
								<Button type="text" onClick={onLogin}>
									로그인
								</Button>
								<Button type="text" onClick={onSignin}>
									회원가입
								</Button>
							</FlexMenu>
						</HeaderContainer>
					</Col>
				</GridRow>
			</Header>
			<main>
				<MainWrapper>
					<Row>
						<Col></Col>
					</Row>
				</MainWrapper>
			</main>
			<footer></footer>
		</>
	);
};

export default SigninLayout;
